
var setFormContent=function (divtable,indexlegend) {
    var LODOP=getLodop();
    LODOP.PRINT_INIT("打印控件：打印表格");
    // LODOP.SET_PRINT_PAGESIZE(2, "2000","2400","");
    LODOP.ADD_PRINT_HTM(35,"5%","90%",500,divtable);
    LODOP.SET_PRINT_STYLEA(0,"Vorient",3);
    LODOP.ADD_PRINT_TEXT(10,34,196,20,indexlegend);
    LODOP.SET_PRINT_STYLEA(0,"ItemType",1);
    LODOP.PREVIEW();
};
